import React, { useRef } from 'react'
import { useSpring } from 'react-spring'

import { WrapImageAnimateWrap, BoxImageAnimate } from '../../../components/Layout';

const calc = (x, y, r) => [x - r.left - r.width / 2, y - r.top - r.height / 2];
const trans1 = (x, y) => `translate3d(${x / 15}px,${y / 15}px,0)`;
const trans2 = (x, y) => `translate3d(${x / 10 + 15}px,${y / 10 - 10}px,0)`;
const trans3 = (x, y) => `translate3d(${x / 8 - 100}px,${y / 8 - 10}px,0)`;
const trans4 = (x, y) => `translate3d(0px,${y / 3.5 - 20}px,0)`;
const trans5 = (x, y) => `translate3d(0px,${y / 3.8 - 20}px,0)`;

export function AnimateImg() {
    const ref = useRef(null);
    const [props, set] = useSpring(() => ({
        xy: [0, 0],
        config: { mass: 5, tension: 550, friction: 100 },
    }));
    return (
        <WrapImageAnimateWrap
            ref={ref}
            className="container"
            onMouseMove={e => {
                const rect = ref.current.getBoundingClientRect()
                set({ xy: calc(e.clientX, e.clientY, rect) })
            }}>
            <BoxImageAnimate image={'data:image/svg+xml;base64,'} variant='var3' style={{ transform: props.xy.interpolate(trans1) }} />
            <BoxImageAnimate image={'data:image/svg+xml;base64,'} variant='var2' style={{ transform: props.xy.interpolate(trans2) }} />
            <BoxImageAnimate image={'data:image/svg+xml;base64,'} variant='var1' style={{ transform: props.xy.interpolate(trans3) }} />
            <BoxImageAnimate image={'data:image/svg+xml;base64,'} variant='var4' style={{ transform: props.xy.interpolate(trans4) }} />
            <BoxImageAnimate image={'data:image/svg+xml;base64,'} variant='var5' style={{ transform: props.xy.interpolate(trans5) }} />
        </WrapImageAnimateWrap>
    )
}
